		this.isAlive = true;
		this.nextCell = null;
		this.cell.x = tx;
		this.cell.y = ty;
		this.x = this.cell.x * this.tilemap.tileset.tileSize;
		this.y = this.cell.y * this.tilemap.tileset.tileSize;
		this.game.teamsGrid[this.cell.y][this.cell.x] = this.team;
